import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

export default class SignIn extends Component {
    render() {
        return (
            <div>
                <Router>
                    <Routes/>
                </Router>
            </div>
        )
    }
}

const Login = () => {
    return (
        <div>
            <button>Login</button>
        </div>
    )
}

const Dashboard = () => {
    return (
        <div>
            <h1>Dashboard</h1>
            <button>Logout</button>
        </div>
    )
}

const Routes = () => {
    return (
        <Switch>
            <Route to path="/login" component={Login}/>
            <Route to path="/dashboard" component={Dashboard}/>
        </Switch>
    )
}

const ProtectedRoutes = () => {
    return(
        <Route/>
    )
}
